window.bookSummaryJSON = "<p><b>He’s no Prince Charming....</b></p> <p>Callum Griffin is the heir to the Irish mafia. He’s ruthless, arrogant, and he wants to kill me. </p> <p>We got off on the wrong foot when I set a (very small) fire in his house. Our families believe a marriage pact is the only thing that will prevent all-out warfare.</p> <p>I think I might need to murder him while he sleeps. This would all be a lot easier if Callum wasn’t so damned good-looking.</p> <p>But I’ve got a lockbox around my heart. Because, even if I’m forced to marry him, I could never love a brutal prince.</p> <p><i>Brutal Prince </i>is the explosive first act in the epic Brutal Birthright series. It’s a stand-alone dark Mafia romance, complete with HEA and no cliff-hangers. It contains blazing-hot bedroom scenes for mature listeners only!</p>"; 
